static bool init_memory(wasm2c_sandbox_t* const sbx, uint32_t max_wasm_pages_from_rt) {
  const uint32_t max_pages_specified_in_module = 0;
  const uint32_t max_pages = max_wasm_pages_from_rt == 0? max_pages_specified_in_module : max_wasm_pages_from_rt;
  const bool success = wasm_rt_allocate_memory(&(sbx->w2c_memory), 18, max_pages);
  if (!success) { return false; }
  
  LOAD_DATA(sbx->w2c_memory, 100000u, data_segment_data_0, 4);
  sbx->wasi_data.heap_memory = &(sbx->w2c_memory);
  return true;
}

static void cleanup_memory(wasm2c_sandbox_t* const sbx) {
  wasm_rt_deallocate_memory(&(sbx->w2c_memory));
}

static wasm_rt_memory_t* get_wasm2c_memory(void* aSbx) {
  wasm2c_sandbox_t* const sbx = (wasm2c_sandbox_t* const) aSbx;return &(sbx->w2c_memory);
}

static void init_table(wasm2c_sandbox_t* const sbx) {
  uint32_t offset = 0;
  wasm_rt_allocate_table(&(sbx->w2c___indirect_function_table), 2, 4294967295);
  offset = 1u;
  sbx->w2c___indirect_function_table.data[offset + 0] = (wasm_rt_elem_t){ WASM_RT_INTERNAL_FUNCTION, sbx->func_types[0], (wasm_rt_anyfunc_t)(&w2c__black_box) };
  sbx->w2c___indirect_function_table_current_index = offset + 1;
}

static void cleanup_table(wasm2c_sandbox_t* const sbx) {
  wasm_rt_deallocate_table(&(sbx->w2c___indirect_function_table));
}

static void* lookup_wasm2c_nonfunc_export(void* sbx_ptr, const char* name) {
  wasm2c_sandbox_t* const sbx = (wasm2c_sandbox_t* const) sbx_ptr;
  if (strcmp("w2c_memory", name) == 0){
    return &(sbx->w2c_memory);
  }
  if (strcmp("w2c___indirect_function_table", name) == 0){
    return &(sbx->w2c___indirect_function_table);
  }
  if (strcmp("w2c___stack_pointer", name) == 0){
    return &(sbx->w2c___stack_pointer);
  }
  if (strcmp("w2c___dso_handle", name) == 0){
    return &(sbx->w2c___dso_handle);
  }
  if (strcmp("w2c___data_end", name) == 0){
    return &(sbx->w2c___data_end);
  }
  if (strcmp("w2c___global_base", name) == 0){
    return &(sbx->w2c___global_base);
  }
  if (strcmp("w2c___heap_base", name) == 0){
    return &(sbx->w2c___heap_base);
  }
  if (strcmp("w2c___memory_base", name) == 0){
    return &(sbx->w2c___memory_base);
  }
  if (strcmp("w2c___table_base", name) == 0){
    return &(sbx->w2c___table_base);
  }
  return 0;
}

static wasm_rt_table_t* get_wasm2c_callback_table(void* sbx_ptr){
  wasm2c_sandbox_t* const sbx = (wasm2c_sandbox_t* const) sbx_ptr;
  return &(sbx->w2c___indirect_function_table);
}

